import { makeStyles } from '@material-ui/core/styles';

export default makeStyles((theme) => ({
    appBarSearch: {
        borderRadius: 4,
        marginBottom: '1rem',
        display: 'flex',
        padding: '16px',
    },
    pagination: {
        marginTop: '1rem',
        padding: '16px',

    },
    [theme.breakpoints.down('sm')]: {
        mainContainer: {
            flexDirection: 'column-reverse',
        },
    },
    gridContainer: {
        [theme.breakpoints.down('xs')]: {
            flexDirection: 'column-reverse',
        },
    },
    ul: {
        '& .MuiPaginationItem-root': {
            '&.Mui-selected': {
                background: 'red',
                color: 'white',
                // borderRadius: '50%',
            },
        },
    },
}));
